import React from 'react';

class Form extends React.Component {
  render() {
    return (
      <form>
        <fieldset>
          <label htmlFor='Name'>Name</label>
          <input name='Name' type='text' maxLength='40' required />
          <label htmlFor='Email'>Name</label>
          <input name='Email' type='text' maxLength='50' required />
          <label htmlFor='CPF'>CPF</label>
          <input name='CPF' type='text' maxLength='40' required />
          <label htmlFor='Adress'>Adress</label>
          <input name='Adress' type='text' maxLength='40' required />
          <label htmlFor='City'>City</label>
          <input name='City' type='text' maxLength='40' required />
        </fieldset>
      </form>
    );
  }
}

export default Form;
